    import { initializeApp } from "https://www.gstatic.com/firebasejs/9.6.1/firebase-app.js";

    const firebaseConfig = {
      apiKey: "AIzaSyBVMpOCjY9gdd4UkSa",

      document.body.removeChild(a);
    };

    onValue(ref(db, "users"), renderUsers);
